Number.prototype.pad = function(size) {
	// 0-pad numbers
	let s = String(this);
	while (s.length < (size || 2)) {
		s = '0' + s;
	}
	return s;
};

const Interval = function(d) {
	return (
		d || {
			duration: 60, // seconds
			description: '',
			sound: 'Bell'
		}
	);
};

const snapSound = getSnapSound();
const bellSound = getBellSound();
const wowSound = getWowSound();

const timerDoneStr = 'Done!';
const timerReadyStr = 'Get Ready!';

const app = new Vue({
	el: '#app',
	data: {
		currentInterval: 0,
		currentRound: 0,
		handle: null, // for setTimeout
		intervals: [
			new Interval({ description: 'GO!', duration: 20, sound: 'Bell' }),
			new Interval({ description: 'Rest', duration: 10, sound: 'Snap' })
			// new Interval({ description: 'Run', duration: 2, sound: 'Bell' }),
			// new Interval({ description: 'Bike', duration: 2, sound: 'Snap' })
		],
		appMode: 'setup', // setup | timer
		timerMode: 'ready', // ready | running | done
		prepTime: 5, // seconds
		time: 0, // seconds
		timerTitle: '',
		rounds: 8,
		workoutName: 'Tabata'
		// rounds: 2, // test
		// workoutName: 'Test'
	},
	methods: {
		addInterval: function(interval) {
			this.intervals.push(new Interval(interval));
		},
		deleteInterval: function(index) {
			this.intervals.splice(index, 1)[0];
			if (this.intervals.length < 1) {
				this.addInterval();
			}
		},
		workoutPrepare: function() {
			// must play sounds as result of click event so safari will allow them to play automatically in the future
			// play and immediately mute
			wowSound.play();
			wowSound.muted = true;

			bellSound.play();
			bellSound.muted = true;

			snapSound.play();
			snapSound.muted = true;

			this.appMode = 'timer';
			if (!this.prepTime) {
				this.timerMode = 'running';
				this.workoutStart();
				return;
			}

			const self = this;
			this.time = this.prepTime;
			this.handle = setInterval(countdown, 1000);

			function countdown() {
				self.time -= 1;
				if (self.time <= 0) {
					// unmute sounds
					bellSound.muted = false;
					snapSound.muted = false;
					wowSound.muted = false;
					self.timerMode = 'running';
					self.workoutStart();
				}
			}
		},
		workoutStart: function() {
			this.appMode = 'timer';
			this.timerResetAll();
			this.timerStart();
		},
		workoutEnd: function() {
			this.appMode = 'setup';
			this.timerMode = 'ready';
			this.timerResetAll();
		},
		timerCountUp: function() {
			this.time += 1;

			if (this.time >= this.intervals[this.currentInterval].duration) {
				// slight pause so user can see last second
				const self = this;
				setTimeout(() => {
					self.timerNext();
				}, 250);
			}
		},
		timerNext: function() {
			this.timerReset();

			if (app.currentInterval + 1 < app.intervals.length) {
				// next interval
				this.currentInterval += 1;
				this.timerStart();
			} else if (app.currentRound + 1 < app.rounds) {
				// next round
				this.currentInterval = 0;
				this.currentRound += 1;
				this.timerStart();
			} else {
				// done
				wowSound.play();
				this.timerMode = 'done';
			}
		},
		timerStart: function() {
			if (this.timerMode === 'ready') {
				this.workoutPrepare();
				return;
			}

			const i = this.currentInterval;
			this.timerTitle = this.intervals[i].description || `Interval ${i + 1}`;

			const iSound = this.intervals[i].sound;
			if (iSound === 'Bell') {
				bellSound.play();
			} else if (iSound === 'Snap') {
				snapSound.play();
			}

			this.handle = setInterval(this.timerCountUp, 1000);
		},
		timerStop: function() {
			clearInterval(this.handle);
			this.handle = null;
		},
		timerReset: function() {
			this.timerStop();
			this.time = 0;
		},
		timerResetAll: function(resetMode) {
			if (resetMode) {
				this.timerMode = 'ready';
			}

			this.timerTitle = '';
			this.timerReset();
			this.currentInterval = 0;
			this.currentRound = 0;
		},
		saveWorkout: function() {
			/* TODO  */
		},
		openWorkout: function() {
			/* TODO  */
		},
		deleteWorkout: function() {
			/* TODO  */
		}
	},
	computed: {
		totalDuration: function() {
			const eachRound = this.intervals.reduce((total, interval) => {
				return total + Number(interval.duration);
			}, 0);

			return eachRound * this.rounds;
		},
		minutes: function() {
			return Math.floor(this.time / 60).pad(2);
		},
		seconds: function() {
			return (this.time % 60).pad(2);
		},
		showPauseBtn: function() {
			return Boolean(this.handle);
		},
		showPlayBtn: function() {
			return !this.handle && this.timerMode !== 'done';
		},
		timerClass: function() {
			const title = this.timerTitle;
			if (this.timerMode === 'done') {
				return 'done';
			}

			const rest = /rest/i.test(title);
			const getReady = this.timerMode === 'ready';
			return rest || getReady ? 'rest' : 'go';
		},
		timerModeTitle: function() {
			if (this.timerMode === 'ready') {
				return timerReadyStr;
			}

			if (this.timerMode === 'done') {
				return timerDoneStr;
			}
		}
	}
});

// sounds from: https://www.soundjay.com/
// generated base64 using: https://dopiaza.org/tools/datauri/index.php
function getSnapSound() {
	return new Audio(
		'data:audio/mp3;base64,'
	);
}

function getBellSound() {
	return new Audio(
		'data:audio/mp3;base64,'
	);
}

function getWowSound() {
	return new Audio(
		'data:audio/mp3;base64,'
	);
}
